contracts/EscrowVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

// ---------------------------------------------------------------------
//  Import non-upgradeable OpenZeppelin contracts
// ---------------------------------------------------------------------
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

// For token interfaces
import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155Receiver.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

// Warp Portal interface
interface IPortal {
    function messageToll() external view returns (uint256);
    function sendMessage(bytes3 _destinationChain, bytes32 _destination, bytes32[] calldata _contents) external payable;
}

/**
 * @title EscrowVault
 * @notice This contract holds assets (e.g., ERC-1155 tokens) in escrow during a cross-chain transfer via warp.green.
 *         It collects a toll in ETH for the message relay, locks the asset on Ethereum, and requests an unlock/mint
 *         on the target chain. Later, it can release the asset back to the user upon a valid cross-chain message
 *         from the warp portal.
 *
 * @dev
 * - Inherits Ownable for simple owner-based access control.
 * - Inherits Pausable for an emergency stop mechanism controlled by the owner.
 * - Inherits ReentrancyGuard to prevent reentrant calls on sensitive functions.
 * - Implements IERC1155Receiver and IERC721Receiver to safely receive tokens if needed.
 */
contract EscrowVault is
    Ownable,
    Pausable,
    ReentrancyGuard,
    IERC1155Receiver,
    IERC721Receiver
{
    /// @notice The address of the warp portal contract (authorized to call receiveMessage).
    address public warpPortal;

    /// @notice Where USDC or other payouts might be sent if needed (in this example, we store it for possible expansions).
    address public payoutAddress;

    /// @notice The ERC-1155 token contract representing assets to be escrowed.
    IERC1155 public nftContract;

    /// @notice Used if you want to restrict the cross-chain messages to a known chain ID, e.g. "xch".
    bytes3 public sourceChain;

    /// @notice Trusted puzzle hash on the remote chain that we expect to send valid messages.
    bytes32 public trustedSource;

    /// @notice The puzzle hash on the remote chain that receives messages from this side.
    bytes32 public unlockerPuzzleHash;

    /// @notice Tracks message nonces we've processed, preventing replay attacks.
    mapping(bytes32 => bool) private usedNonces;

    // ----------------------------------------------------------
    // Data structures for deposit records
    // ----------------------------------------------------------

    struct Deposit {
        address user;        // The EVM address of the user who deposited
        bytes32 puzzleHash;  // The user’s puzzle hash on the remote chain
        uint256 assetId;     // ID of the escrowed ERC-1155 token
        uint256 assetAmount; // How many tokens were escrowed
        bool completed;      // Whether this deposit has been finalized
    }

    /// @notice Counter for deposit IDs (1-based).
    uint256 public depositCount;

    /// @notice depositId => Deposit struct
    mapping(uint256 => Deposit) public deposits;

    /// @notice Maps an ERC-1155 assetId to its active depositId (if any), ensuring one deposit per ID.
    mapping(uint256 => uint256) public activeDeposits;

    // ----------------------------------------------------------
    // Events
    // ----------------------------------------------------------

    event PaymentDeposited(
        address indexed user,
        bytes32 indexed targetPuzzleHash,
        uint256 assetId,
        uint256 amount,
        uint256 tollPaid,
        uint256 depositId
    );

    event PayoutCompleted(
        address indexed recipient,
        uint256 assetId,
        uint256 amount,
        uint256 depositId
    );

    event PayoutSetByAdmin(
        uint256 indexed depositId,
        address indexed recipient
    );

    // ----------------------------------------------------------
    // Constructor
    // ----------------------------------------------------------

    /**
     * @notice EscrowVault constructor, sets up references to USDC / warp portal / payout address, etc.
     * @param _nftContract The address of the ERC-1155 contract whose tokens will be escrowed.
     * @param _warpPortal The warp portal contract address (authorized to call receiveMessage).
     * @param _payoutAddress The address to which payouts might be sent.
     */
    constructor(
        address _nftContract,
        address _warpPortal,
        address _payoutAddress
    ) {
        require(_nftContract != address(0), "NFT contract = zero");
        require(_warpPortal != address(0), "WarpPortal = zero");
        require(_payoutAddress != address(0), "Payout address = zero");

        nftContract = IERC1155(_nftContract);
        warpPortal = _warpPortal;
        payoutAddress = _payoutAddress;
    }

    // ----------------------------------------------------------
    // User Functions
    // ----------------------------------------------------------

    /**
     * @notice Deposit an ERC-1155 token into escrow and pay the warp toll in ETH. Triggers a cross-chain message.
     * @param targetPuzzleHash The user’s puzzle hash on the remote chain (destination).
     * @param assetId The ID of the ERC-1155 token.
     * @param assetAmount The number of tokens to escrow (for 1-of-1 NFTs, this is 1).
     */
    function depositPayment(
        bytes32 targetPuzzleHash,
        uint256 assetId,
        uint256 assetAmount
    ) external payable whenNotPaused nonReentrant {
        // 1) Check warp toll
        uint256 toll = IPortal(warpPortal).messageToll();
        require(msg.value == toll, "Incorrect warp toll");

        // 2) Check deposit conditions
        require(assetAmount > 0, "Asset amount=0");
        require(targetPuzzleHash != bytes32(0), "targetPuzzleHash=zero");
        require(activeDeposits[assetId] == 0, "Asset ID is in active deposit");

        // 3) Transfer the token from user => vault
        nftContract.safeTransferFrom(msg.sender, address(this), assetId, assetAmount, "");

        // 4) Record the deposit
        depositCount += 1;
        uint256 depositId = depositCount;
        deposits[depositId] = Deposit({
            user: msg.sender,
            puzzleHash: targetPuzzleHash,
            assetId: assetId,
            assetAmount: assetAmount,
            completed: false
        });
        activeDeposits[assetId] = depositId;

        emit PaymentDeposited(msg.sender, targetPuzzleHash, assetId, assetAmount, msg.value, depositId);

        // 5) Warp the message cross-chain
        bytes32[] memory contents = new bytes32[](3);
        contents[0] = targetPuzzleHash;
        contents[1] = bytes32(assetId);
        contents[2] = bytes32(assetAmount);

        IPortal(warpPortal).sendMessage{ value: toll }(sourceChain, unlockerPuzzleHash, contents);
    }

    // ----------------------------------------------------------
    // Cross-Chain Receiver
    // ----------------------------------------------------------

    /**
     * @notice Called by the warp portal once it verifies a cross-chain message from the remote chain.
     * @dev Expects contents to have at least 3 items:
     *       [0] => recipient (uint160 in bytes32)
     *       [1] => assetId
     *       [2] => amount
     */
    function receiveMessage(
        bytes32 _nonce,
        bytes3 _source_chain,
        bytes32 _source,
        bytes32[] calldata _contents
    ) external whenNotPaused nonReentrant {
        require(msg.sender == warpPortal, "Not warp portal");
        require(_source_chain == sourceChain, "Wrong source chain");
        require(_source == trustedSource, "Unknown source puzzle");

        // Replay protection
        bytes32 key = keccak256(abi.encodePacked(_source_chain, _nonce));
        require(!usedNonces[key], "Replay detected");
        usedNonces[key] = true;

        // Parse contents
        require(_contents.length >= 3, "Invalid contents");
        address recipient = address(uint160(uint256(_contents[0])));
        require(recipient != address(0), "Recipient=zero");
        uint256 assetId = uint256(_contents[1]);
        uint256 amount = uint256(_contents[2]);

        // Lookup deposit
        uint256 depositId = activeDeposits[assetId];
        require(depositId != 0, "No active deposit");
        Deposit storage dep = deposits[depositId];
        require(!dep.completed, "Deposit completed");
        require(amount <= dep.assetAmount, "Over deposit amount");

        // Mark completed
        dep.completed = true;
        activeDeposits[assetId] = 0;

        // Transfer from vault => recipient
        nftContract.safeTransferFrom(address(this), recipient, assetId, amount, "");

        emit PayoutCompleted(recipient, assetId, amount, depositId);
    }

    // ----------------------------------------------------------
    // Admin Functions
    // ----------------------------------------------------------

    /**
     * @notice Admin function for emergency or manual release of an escrowed asset.
     * @param depositId The deposit record to finalize.
     * @param recipient The address to receive the asset.
     */
    function setPayout(uint256 depositId, address recipient)
        external
        onlyOwner
        whenNotPaused
        nonReentrant
    {
        require(depositId != 0 && depositId <= depositCount, "Invalid depositId");
        require(recipient != address(0), "Recipient=zero");

        Deposit storage dep = deposits[depositId];
        require(!dep.completed, "Already completed");

        dep.completed = true;
        activeDeposits[dep.assetId] = 0;

        // Transfer from vault => recipient
        nftContract.safeTransferFrom(address(this), recipient, dep.assetId, dep.assetAmount, "");

        emit PayoutSetByAdmin(depositId, recipient);
        emit PayoutCompleted(recipient, dep.assetId, dep.assetAmount, depositId);
    }

    /**
     * @notice Pause the contract to disable deposits and cross-chain receives.
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @notice Unpause the contract.
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    // ----------------------------------------------------------
    // ERC1155 / ERC721 Receiver
    // ----------------------------------------------------------

    function onERC1155Received(
        address /* operator */,
        address /* from */,
        uint256 /* id */,
        uint256 /* value */,
        bytes calldata /* data */
    ) external override returns (bytes4) {
        // We only accept if msg.sender is our designated nftContract
        require(msg.sender == address(nftContract), "Unrecognized ERC1155 sender");
        return this.onERC1155Received.selector;
    }

    function onERC1155BatchReceived(
        address /* operator */,
        address /* from */,
        uint256[] calldata /* ids */,
        uint256[] calldata /* values */,
        bytes calldata /* data */
    ) external override returns (bytes4) {
        require(msg.sender == address(nftContract), "Unrecognized ERC1155 batch sender");
        // If you need batch logic, handle it here
        return this.onERC1155BatchReceived.selector;
    }

    function onERC721Received(
        address /* operator */,
        address /* from */,
        uint256 /* tokenId */,
        bytes calldata /* data */
    ) external override returns (bytes4) {
        // Only accept from a recognized NFT contract, if you plan to do ERC721
        return this.onERC721Received.selector;
    }

    /**
     * @dev Supports interface detection for ERC1155Receiver, ERC721Receiver if needed.
     */
    function supportsInterface(bytes4 interfaceId) external pure returns (bool) {
        return (interfaceId == type(IERC1155Receiver).interfaceId)
            || (interfaceId == type(IERC721Receiver).interfaceId);
    }
}

